import React from 'react';

function GigList({ gigs }) {
  return (
    <div>
      <h2>Available Gigs</h2>
      {gigs.map(g => (
        <div key={g._id} style={{ border: '1px solid #ccc', margin: '10px', padding: '10px' }}>
          <h3>{g.title}</h3>
          <p>{g.description}</p>
          <p><strong>Budget:</strong> ${g.budget}</p>
          <small>Posted by: {g.postedBy}</small>
        </div>
      ))}
    </div>
  );
}

export default GigList;
